import { Row, Col, Card } from "react-bootstrap";

const BugItem = ({ bug }) => {
  return (
    <Card className="mb-3">
      <Card.Header>
        <Row>
          <Col>{bug.id}</Col>
          <Col>N</Col>
        </Row>
      </Card.Header>
    </Card>
  );
};

export default BugItem;
